import React, {Component} from 'react';

class Review extends Component {
  render() {
    return (
      <div className="Review">
      <h2 className='ReviewTitle'>{this.title}</h2>
      <p>{this.body}</p>
      <p className='ReviewCommentsAndLikes'>{this.comments} comments {this.likes} likes</p>
      </div>
    )
  }
}

export default Review
